#!/bin/bash

set -e
pkcs12_file=""
keccak256sum=""
output_path="accounts"
keccak_256_bin="/tmp/keccak-256sum"
keccak_256_tar="/tmp/keccak-256sum.tgz"

help() {
    echo $1
    cat << EOF
Usage: $0 
    default       generate account and store private key in PEM format file
    -p            generate account and store private key in PKCS12 format file
    -k [FILE]     calculate address of PEM format [FILE]
    -P [FILE]     calculate address of PKCS12 format [FILE]
    -h Help
EOF

exit 0
}

prepare_keccak256()
{
    if [[ ! -f ${keccak_256_bin} ]];then
        if [ "$(uname)" == "Darwin" ];then
            keccak256sum=""
            echo ${keccak256sum} | base64 -D - > ${keccak_256_tar}
        else
            keccak256sum=""
            echo ${keccak256sum} | base64 -d - > ${keccak_256_tar}
        fi
        tar -zxf ${keccak_256_tar} -C /tmp && rm ${keccak_256_tar}
        chmod u+x ${keccak_256_bin}
    fi
    mkdir -p accounts
}

LOG_INFO()
{
    local content=${1}
    echo -e "\033[32m[INFO] ${content}\033[0m"
}

check_env() {
    [ ! -z "$(openssl version | grep 1.0.2)" ] || [ ! -z "$(openssl version | grep 1.1)" ] || [ ! -z "$(openssl version | grep reSSL)" ] || {
        echo "please install openssl! use \"openssl version\" command to check."
        LOG_INFO "  Ubuntu : sudo apt install -y openssl"
        LOG_INFO "  CentOS : sudo yum install -y openssl"
        LOG_INFO "  macOS  : brew install -y openssl"
        exit 1
    }
    if [ ! -z "$(openssl version | grep reSSL)" ];then
        export PATH="/usr/local/opt/openssl/bin:$PATH"
    fi
}

calculate_address_pem()
{
    local pem_file=$1
    local no_print="$2"
    local suffix=${pem_file##*.}
    if [[ "${suffix}" != "pem" ]];then
        echo "The suffix of ${pem_file} is not pem. Please check it."
        exit 1
    fi
    prepare_keccak256
    privKey=$(openssl ec -in ${pem_file} -text -noout 2>/dev/null| sed -n '3,5p' | tr -d ": \n" | awk '{print $0}')
    pubKey=$(openssl ec -in ${pem_file} -text -noout 2>/dev/null| sed -n '7,11p' | tr -d ": \n" | awk '{print substr($0,3);}')
    accountAddress=$(echo ${pubKey}| ${keccak_256_bin} -x -l | tr -d ' -' | tail -c 41)
    [ ! -z "${no_print}" ] || LOG_INFO "Account Address   : 0x${accountAddress}"
}

calculate_address_pkcs12()
{
    local p12_file=$1
    local pem_file="/tmp/.tmp.pem"
    local suffix=${p12_file##*.}
    if [[ "${suffix}" != "p12" && "${suffix}" != "pfx" ]];then
        echo "The suffix of ${p12_file} is neither p12 nor pfx. Please check it."
        exit 1
    fi
    openssl pkcs12 -in ${p12_file} -out ${pem_file} -nodes
    calculate_address_pem ${pem_file}
    rm ${pem_file}
}

main()
{
    while getopts "k:pP:h" option;do
        case $option in
        k) calculate_address_pem "$OPTARG"
        exit 0;;
        P) calculate_address_pkcs12 "$OPTARG"
        exit 0;;
        p) #pkcs12_file="$OPTARG"
        pkcs12_file="true"
        ;;
        h) help;;
        esac
    done
    check_env
    prepare_keccak256
    if [ ! -f /tmp/secp256k1.param ];then
        openssl ecparam -out /tmp/secp256k1.param -name secp256k1
    fi
    openssl genpkey -paramfile /tmp/secp256k1.param -out ${output_path}/ecprivkey.pem
    calculate_address_pem ${output_path}/ecprivkey.pem "true"
    if [ -z "$pkcs12_file" ];then
        mv ${output_path}/ecprivkey.pem ${output_path}/0x${accountAddress}.pem
        LOG_INFO "Account Address   : 0x${accountAddress}"
        LOG_INFO "Private Key (pem) : ${output_path}/0x${accountAddress}.pem"
        # echo "0x${privKey}" > ${output_path}/${accountAddress}.private.hex
        openssl ec -in ${output_path}/0x${accountAddress}.pem -pubout -out ${output_path}/0x${accountAddress}.public.pem 2>/dev/null
        LOG_INFO "Public  Key (pem) : ${output_path}/0x${accountAddress}.public.pem"
    else
        openssl pkcs12 -export -name key -nocerts -inkey "${output_path}/ecprivkey.pem" -out "${output_path}/0x${accountAddress}.p12" # -passout "pass:${pkcs12_passwd}"
        openssl ec -in ${output_path}/ecprivkey.pem -pubout -out ${output_path}/0x${accountAddress}.public.p12 2>/dev/null
		rm ${output_path}/ecprivkey.pem
        LOG_INFO "Account Address   : 0x${accountAddress}"
        LOG_INFO "Private Key (p12) : ${output_path}/0x${accountAddress}.p12"
		LOG_INFO "Public  Key (p12) : ${output_path}/0x${accountAddress}.public.p12"
    fi
    # LOG_INFO "Private Key (hex) : 0x${privKey}"
    # echo "0x${pubKey}" > ${output_path}/${accountAddress}.public.hex
    # LOG_INFO "Public  File(hex) : ${output_path}/${accountAddress}.public.hex"
}

main $@

